!function(){tinymce.PluginManager.add("fs_button",function(t,n){t.addButton("fs_button",{title:"Add a Button",image:n+"/pdf-icon.png",onclick:function(){t.windowManager.open({title:"Insert a button",body:[{type:"textbox",name:"btn_loc",label:"PDF Link",value:"http://"}],onsubmit:function(n){return""===n.data.btn_loc?(t.windowManager.alert("Please, fill in all fields."),!1):void t.insertContent('<br/>[button url="'+n.data.btn_loc+'"]Download PDF[/button]<br/>')}})}})})}();
